-- Table structure for test_jobs
-- ----------------------------
DROP TABLE IF EXISTS `test_jobs`;
CREATE TABLE `test_jobs` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL COMMENT '调度名称',
  `startdate` varchar(100) DEFAULT NULL COMMENT '开始日期',
  `starttime` varchar(100) DEFAULT NULL COMMENT '开始时间',
  `enddate` varchar(100) DEFAULT NULL COMMENT '结束日期',
  `endtime` varchar(100) DEFAULT NULL COMMENT '结束时间',
  `runtime` datetime DEFAULT NULL COMMENT '执行时间',
  `remark` varchar(800) DEFAULT NULL COMMENT '备注',
  `planproj` varchar(100) DEFAULT NULL COMMENT '项目名（testlink）中',
  `state` varchar(4) NOT NULL COMMENT '状态',
  `tasktype` varchar(4) NOT NULL COMMENT '执行类型 O执行一次 D每天执行',
  `starttimestr` varchar(100) DEFAULT NULL COMMENT '执行时间表达式',
  `endtimestr` varchar(100) DEFAULT NULL COMMENT '结束时间',
  `createtime` datetime NOT NULL,
  `noenddate` varchar(10) DEFAULT NULL COMMENT '是否有结束日期',
  `time` int(11) DEFAULT '0',
  `timetype` varchar(4) DEFAULT NULL,
  `issendmail` varchar(4) DEFAULT '0' COMMENT '是否发送邮件通知',
  `emailer` varchar(250) DEFAULT NULL COMMENT '邮件地址',
  `threadcount` int(11) DEFAULT '1' COMMENT '客户端线程数(接口)',
  `testlinkname` varchar(200) DEFAULT NULL COMMENT 'TESTLINK中的计划名称',
  `isbuilding` varchar(4) NOT NULL DEFAULT '0' COMMENT '是否自动构建',
  `buildname` varchar(100) DEFAULT NULL COMMENT '构建链接',
  `isrestart` varchar(4) NOT NULL DEFAULT '0' COMMENT '是否自动重启',
  `restartcomm` varchar(200) DEFAULT NULL COMMENT '重启脚本',
  `extype` int(4) NOT NULL DEFAULT '0' COMMENT '执行类型',
  `browsertype` int(4) DEFAULT NULL COMMENT 'UI自动化浏览器类型',
  `timeout` int(8) NOT NULL DEFAULT '60' COMMENT '任务超时中断时间(分钟)',
  `clientip` varchar(30) NOT NULL DEFAULT '127.0.0.1' COMMENT '版本ID',
  `clientpath` varchar(100) DEFAULT NULL COMMENT '客户端测试驱动桩路径',
  `projecttype` int(4) DEFAULT '0' COMMENT '项目类型 系统内项目 0 testlink 1',
  `projectid` int(8) DEFAULT NULL COMMENT '系统内项目ID',
  `planid` int(8) DEFAULT NULL COMMENT '系统内项目关联测试计划ID',
  `sendcondition` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

